import React from "react";

class Memories extends React.Component {
  render() {
    return (
      <>
        <div
          style={{
            height: "95%",
            width: this.state.width,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            fontFamily: "Dancing",
            borderRadius: "25px",
            boxShadow: "3px 6px 10px 10px #585858",
          }}
        ></div>
      </>
    );
  }
}
export default Memories;
